const moduleTexture = {
	textures: [
		//main
		{
			name: "bg",
			path: "data:image/jpeg;base64,",
		},
		{
			name: "btn-bg",
			path: "data:image/png;base64,",
		},
		{
			name: "wood",
			path: "data:image/png;base64,",
		},
		{
			name: "axe",
			path: "data:image/png;base64,",
		},
		{
			name: "logo",
			path: "data:image/png;base64,",
		},
	],

	baseTextures: {},
	threeTextures: {},
	pixiTextures: {},
	funComplete: null,
	load: function (_funComplete) {
		moduleTexture.funComplete = _funComplete;
		moduleTexture.loadTexture();
	},
	idLoadTexture: 0,
	loadTexture: function () {
		if (moduleTexture.idLoadTexture < moduleTexture.textures.length) {
			moduleTexture.baseTextures[
				moduleTexture.textures[moduleTexture.idLoadTexture].name
			] = new Image();

			moduleTexture.baseTextures[
				moduleTexture.textures[moduleTexture.idLoadTexture].name
			].onload = moduleTexture.loadTextureComplete;
			moduleTexture.baseTextures[
				moduleTexture.textures[moduleTexture.idLoadTexture].name
			].onerror = moduleTexture.loadTextureError;
			moduleTexture.baseTextures[
				moduleTexture.textures[moduleTexture.idLoadTexture].name
			].src = moduleTexture.textures[moduleTexture.idLoadTexture].path;
		} else {
			moduleTexture.funComplete();
		}
	},
	loadTextureComplete: function () {
		moduleTexture.pixiTextures[
			moduleTexture.textures[moduleTexture.idLoadTexture].name
		] = PIXI.Texture.from(
			moduleTexture.textures[moduleTexture.idLoadTexture].path
		);

		moduleTexture.idLoadTexture++;
		moduleTexture.loadTexture();
	},
	loadTextureError: function () {
		setTimeout(moduleTexture.loadTexture, 200);
	},
};
